import styled from "styled-components";
//import Check from "../Img/ei_check.svg";

interface TODOOBJ {
  name: string;
  tag: string;
  color: string;
}

const TodoList = styled.li`
  display: flex;
  width: 100%;
  height: 30px;
`;

export default function TodoLi(props: { todo: TODOOBJ }) {
  console.log(props);
  return (
    <TodoList>
      <span>{todo.name}</span>
    </TodoList>
  );
}
